import Vue from 'vue';
export default Vue.extend({
  props: {
    appName: String,
  },
  data() {
    return {
      info: {
        name: '',
        icon: '',
        title: '',
      },
    };
  },
  mounted() {
    // 拼接路径，设置应用信息
    this.$store
      .dispatch('getAppInfo', this.appName)
      .then(info => {
        this.info = info;
      })
      .catch(console.error);
  },
});
